  sort: true,
  filter: numberFilter(
    {
      placeholder: 'Введите вес'
    }
  )},{
  dataField:'character',
  text:'ХАРАКТЕР',
  sort: true,
  filter: selectFilter({
    options: selectCharacters,
    placeholder: 'Выберите характер'
