    options: selectTypes,
    placeholder: 'Выберите тип'
  })},{
  dataField:'x',
  text:'Х',
  sort: true,
  filter: numberFilter(
    {
      placeholder: 'Введите Х'
    }
  )},{
  dataField:'y',
  text:'У',
  sort: true,
  filter: numberFilter(
    {
      placeholder: 'Введите У'
    }
  )},{
  dataField:'cave',
  text:'ГЛУБИНА ПЕЩЕРЫ',
  sort: true,
  filter: numberFilter(
    {
      placeholder: 'Введите глубину пещеры'
    }
  )},{
  dataField:'treasure',
  text:'КОЛИЧЕСТВО СОКРОВИЩ',
  sort: true,
  filter: numberFilter(
    {
      placeholder: 'Введите количество сокровищ'
    }
  )}
];


